function FooterBottom() {
  return (
    <div>
      <div>
        <img
          src="https://www.mcdonalds.com.tr/assets/img/footer-social.png"
          alt=""
        />
        Sosyal Medyada McDonald's
      </div>
      <div>
        <img
          src="https://www.mcdonalds.com.tr/assets/img/footer-icons.png"
          alt=""
        />
      </div>
      <div></div>
      <div></div>
    </div>
  );
}

export default FooterBottom;
